import LogoBrand from '../assests/images/Logo_Brand.png'

function Header() {
    return (
    <>
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
        <div class="container-fluid">
        <a href='/login'>Đăng nhập</a>
        </div>
    </nav>
    </>
    )
}

export default Header
